import React from 'react';
import styles from './Header.css';


const header = () => (
    <header>
        <nav >
        <ul>
  <li className={styles.li}><a href="">Home</a></li>
  <li><a href="">Portfolio</a></li>
  <li><a href="">Contact</a></li>
  <li><a href="">About</a></li>
</ul>
        </nav>
    </header>
);

export default header;
